#include "includes.h"
#include "TalComponent.h"


TalComponent::TalComponent (TalCore* const ownerFilter) : AudioProcessorEditor (ownerFilter)
{
    TalCore* const filter = getFilter();

    const Image image = ImageCache::getFromMemory(bmp00128_png, bmp00128_pngSize);

    int width = 620;
    int height = 220;
    envelopeEditorView = new EnvelopeEditorView(filter, width, height);
	addAndMakeVisible(envelopeEditorView);

    envelopeEditorView->setBackgroundColor(Colour((const uint8)10, (const uint8)10, (const uint8)10, (const uint8)120));
    envelopeEditorView->setSplineColor(Colour((const uint8)200, (const uint8)200, (const uint8)200, (const uint8)200));

    envelopeEditorView->setBounds(10, 10, width, height);

	speedFactorComboBox = addComboBox(10, height + 20, 80, ownerFilter, SPEEDFACTOR);
	speedFactorComboBox->addItem(T("x1"),1);
	speedFactorComboBox->addItem(T("x2"),2);
	speedFactorComboBox->addItem(T("x4"),3);
	speedFactorComboBox->addItem(T("x8"),4);
	speedFactorComboBox->addItem(T("x16"),5);
	speedFactorComboBox->addItem(T("x32"),6);
	speedFactorComboBox->addItem(T("-"),7);

    filtertypeComboBox = addComboBox(110, height + 20, 80, ownerFilter, FILTERTYPE);
	filtertypeComboBox->addItem(T("LP 24dB"),1);
	filtertypeComboBox->addItem(T("LP 18dB"),2);
	filtertypeComboBox->addItem(T("LP 12dB"),3);
	filtertypeComboBox->addItem(T("LP 6dB"),4);
	filtertypeComboBox->addItem(T("HP 12dB"),5);
	filtertypeComboBox->addItem(T("BP 12dB"),6);
	filtertypeComboBox->addItem(T("Notch"),7);
	filtertypeComboBox->addItem(T("Volume"),8);
	filtertypeComboBox->addItem(T("Pan"),9);
	filtertypeComboBox->addItem(T("-"),10);

	const Image knobImage = ImageCache::getFromMemory(bmp00135_png, bmp00135_pngSize);
	int numberOfImages = knobImage.getHeight() / knobImage.getWidth();
    resonanceKnob = addNormalKnob(324, height + 39, ownerFilter, knobImage, numberOfImages, RESONANCE);
    depthKnob = addNormalKnob(390, height + 39, ownerFilter, knobImage, numberOfImages, DEPTH);
    volumeInKnob = addNormalKnob(514, height + 39, ownerFilter, knobImage, numberOfImages, VOLUMEIN);
    volumeOutKnob = addNormalKnob(576, height + 39, ownerFilter, knobImage, numberOfImages, VOLUMEOUT);

	// Version info
	versionLabel = new Label("Version Info", "V 1.20");
	versionLabel->setBounds(image.getWidth() - 68, image.getHeight() - 88, 100, 20);
	versionLabel->setColour(Label::textColourId, Colour((juce::uint8)100, (juce::uint8)100, (juce::uint8)100, 0.9f));
    addAndMakeVisible(versionLabel);

    updateParametersFromFilter();

    setSize (image.getWidth(), image.getHeight());
    ownerFilter->addChangeListener (this);
}

TalComponent::~TalComponent()
{
    getFilter()->removeChangeListener (this);
    deleteAllChildren();
}

ComboBox* TalComponent::addComboBox(int x, int y, int width, TalCore* const ownerFilter, int parameter)
{
	ComboBox *comboBox;
	addAndMakeVisible(comboBox = new ComboBox(T("ComboBox")));
	comboBox->setBounds(x, y, width, 20);
	comboBox->setColour(ComboBox::backgroundColourId, Colour((juce::uint8)40, (juce::uint8)40, (juce::uint8)40, 120.0f));
	comboBox->setColour(ComboBox::textColourId, Colour::greyLevel(1.0f));
	comboBox->setColour(ComboBox::buttonColourId, Colour((juce::uint8)8, (juce::uint8)11, (juce::uint8)58, 0.0f));
	comboBox->setColour(ComboBox::arrowColourId, Colour((juce::uint8)8, (juce::uint8)11, (juce::uint8)58, 0.0f));
        comboBox->addListener (this);
	return comboBox;
}

FilmStripKnob* TalComponent::addNormalKnob(int x, int y, TalCore* const ownerFilter, const Image knobImage, int numOfFrames, int parameter)
{
	FilmStripKnob *filmStripKnob;
	addAndMakeVisible(filmStripKnob = new FilmStripKnob(knobImage,
									 numOfFrames,
									 false,
                                     parameter));
    filmStripKnob->setBounds(x, y, knobImage.getWidth(), knobImage.getHeight() / numOfFrames);
	filmStripKnob->addListener (this);
	return filmStripKnob;
}

void TalComponent::sliderDragStarted (Slider* slider)
{
    NamedValueSet values = slider->getProperties();
    if (values.contains(Identifier("index")))
    {
        TalCore* const filter = getFilter();
        filter->beginParameterChangeGesture(values["index"]);
    }
}

void TalComponent::sliderDragEnded (Slider* slider)
{
    NamedValueSet values = slider->getProperties();
    if (values.contains(Identifier("index")))
    {
        TalCore* const filter = getFilter();
        filter->endParameterChangeGesture(values["index"]);
    }
}

void TalComponent::paint (Graphics& g)
{
    g.fillAll (Colour::greyLevel (0.9f));

    const Image image = ImageCache::getFromMemory(bmp00128_png, bmp00128_pngSize);
    g.drawImage (image,
                 0, 0, image.getWidth(), image.getHeight(),
                 0, 0, image.getWidth(), image.getHeight());
}

void TalComponent::changeListenerCallback (ChangeBroadcaster* source)
{
    updateParametersFromFilter();
}

void TalComponent::sliderValueChanged (Slider* caller)
{
    TalCore* const filter = getFilter();
	if (caller == resonanceKnob) filter->setParameterNotifyingHost(RESONANCE, (float)resonanceKnob->getValue());
	if (caller == volumeInKnob) filter->setParameterNotifyingHost(VOLUMEIN, (float)volumeInKnob->getValue());
	if (caller == volumeOutKnob) filter->setParameterNotifyingHost(VOLUMEOUT, (float)volumeOutKnob->getValue());
	if (caller == depthKnob) filter->setParameterNotifyingHost(DEPTH, (float)depthKnob->getValue());
}

void TalComponent::comboBoxChanged (ComboBox* caller)
{
    TalCore* const filter = getFilter();
	if (caller == speedFactorComboBox) filter->setParameterNotifyingHost(SPEEDFACTOR, float(speedFactorComboBox->getSelectedId()-1)/6.0f);
	if (caller == filtertypeComboBox) filter->setParameterNotifyingHost(FILTERTYPE, float(filtertypeComboBox->getSelectedId()-1)/9.0f);
}

//==============================================================================
void TalComponent::updateParametersFromFilter()
{
    TalCore* const filter = getFilter();

    filter->getCallbackLock().enter();
	float speedFactor = filter->getParameter(SPEEDFACTOR)*6.0f+1.0f;
	float filterType = filter->getParameter(FILTERTYPE)*9.0f+1.0f;
	float resonance = filter->getParameter(RESONANCE);
	float volumeIn = filter->getParameter(VOLUMEIN);
	float volumeOut = filter->getParameter(VOLUMEOUT);
	float depth = filter->getParameter(DEPTH);
    filter->getCallbackLock().exit();

    speedFactorComboBox->setSelectedId((int)speedFactor, dontSendNotification);
    filtertypeComboBox->setSelectedId((int)filterType, dontSendNotification);

    resonanceKnob->setValue(resonance, dontSendNotification);
    volumeInKnob->setValue(volumeIn, dontSendNotification);
    volumeOutKnob->setValue(volumeOut, dontSendNotification);
    depthKnob->setValue(depth, dontSendNotification);
}

